import React from 'react';
import logo from '../images/Logo .svg'

const Footer = () => {
  return (
    <footer>
      <section>
        <div>
          <img src={logo} alt='Logo'/>
          <p>This is Domy Text about little lemon restrurant .</p>
        </div>
      </section>
    </footer>
  );
};

export default Footer;
